import Apps from "./components/Apps/Apps";
import "./style/main.scss";
import React from "react";
import WindowManager from "./components/WindowManager/WindowManager";
import { getApps, addApp, removeApp, renameApp } from "./storage/storage";

function App() {
  const [windows, setWindows] = React.useState([]);
  const [apps, setApps] = React.useState([{ label: "aa" }]);

  const spawnWindow = (app) => {
    setWindows([...windows, { ...app, id: windows.length }]);
  };

  const removeWindow = (id) => {
    const filter = windows.filter((window) => window.id !== id);
    setWindows(filter);
  };

  const saveApp = (app) => {
    addApp(app);
    setApps(getApps());
  };

  const deleteApp = (id) => {
    removeApp(id);
    setApps(getApps());
  };

  const setName = (id, name) => {
    renameApp(id, name);
    setApps(getApps());
  };

  React.useEffect(() => {
    if (getApps()) {
      console.log(getApps());
      setApps(getApps());
    } else {
      addApp({
        label: "Browser",
        href: "https://google.com",
        type: "browser",
        noDelete: true,
        icon: " data:image/jpeg;base64,",
      });
      setApps(getApps());
    }
  }, []);

  return (
    <div className="App">
      <Apps
        saveApp={(app) => saveApp(app)}
        //apps={apps}
        apps={apps}
        spawnWindow={(app) => spawnWindow(app)}
        deleteApp={(id) => deleteApp(id)}
        setName={(id, name) => setName(id, name)}
      />
      <WindowManager
        windows={windows}
        setWindows={(app) => setWindows(app)}
        removeWindow={(id) => removeWindow(id)}
        saveApp={(app) => saveApp(app)}
      />
      <p>Chroverlay Alpha Build</p>
    </div>
  );
}

export default App;
